import { Layout, Page, TextStyle } from '@shopify/polaris';

const Index = () => (
	<Page>
		<Layout>
			<TextStyle variation="positive">
      		Sample app using React and Next.js test
    		</TextStyle>
		</Layout>
	</Page>
);

export default Index;
